import { Menu } from '../../common/Constantes';
import { IUser } from './../../backend/Models';
import { Component, OnInit } from '@angular/core';

declare const $: any;

@Component({
  selector: 'app-sidebar',
  templateUrl: './sidebar.component.html',
  styleUrls: ['./sidebar.component.css']
})
export class SidebarComponent implements OnInit {
  menuItems: any;
  currentUser: IUser;
  fullName = 'Marcos Cardoso de Oliveira Neto';
  clubName = 'Identidade 7'
  clubImage = 'data:image/png;base64,'

  constructor() { }

  ngOnInit() {
    this.menuItems = Menu.filter(menuItem => menuItem.isVisible);
  }

  isMobileMenu() {
    if ($(window).width() > 991) {
      return false;
    }
    return true;
  };
}
